  [],\n\t\"revision_timestamp\": \"2015-05-06T23:29:52.113001\",\n\t\"name\": \"omi-aura-ozone-o3-total-column-daily-l2-global-0-25-deg-lat-lon-grid-v003\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The OMI/Aura Level-2G Total Column Ozone
  Data Product OMTO3G (Version 003) is made available ( http://disc.gsfc.nasa.gov/Aura/OMI/omto3g_v003.shtml
  ) from the NASA Goddard Earth Sciences Data and Information Services Center (GES
  DISC) for the public access.n  nOMI provides two total column ozone products OMTO3
  and OMDOAO3 at the pixel resolution (13 x 24 km at nadir) that are based on two
  different algorithms. This Level-2G daily global gridded total column ozone product
  OMTO3G is based on the pixel level OMI Level-2 Total Ozone Product OMTO3. The OMTO3
  product is based on enhanced TOMS version-8 algorithm that essentially uses the
  ultraviolet radiance data at 317.5 and 331.2 nm.n          n(The shortname for this
  Level-2G Total Column Ozone Data product is OMTO3G_V003)nnOMTO3G data product is
  a special Level-2 Global Gridded Product where pixel level data are binned into
  0.25x0.25 degree global grids. It contains the data for all L2 scenes that have
  observation time between UTC times of 00:00:00 and 23:59:59.9999. All data pixels
  that fall in a grid box are saved Without Averaging. Scientist can apply data filtering
  scheme of their choice and create new gridded products. The GES DISC developed interactive
  toolGiovanni(http://giovanni.gsfc.nasa.gov/) provides web based capabilities to
  browse and explore these data.n     nOMTO3G product files are stored in Hierarchical
  Data Format (HDF-EOS5). Each daily data file contains data from the day lit portion
  of the orbits (~14 orbits) and is roughly 150 MB in size. A list of tools for browsing
  and extracting data from these files can be found from the site http://disc.sci.gsfc.nasa.gov/Aura/tools.shtml.n
  \     nThe OMTO3G data product contains almost all parameters that are contained
  in the OMTO3. For example, in addition to the total column ozone it also contains
  \ UV aerosol index, cloud fraction, cloud pressure, terrain height, geolocation,
  solar and satellite viewing angles, and extensive quality flags.\",\n\t\"license_title\":
